import React from 'react';
import { Container, Grid, GridRow, Header, Segment } from 'semantic-ui-react';


export default ({ controles }) => (
    <Container style={{ width: "100%" }}>
        <Grid style={{ width: "100%" }}>
            {controles.map(controle => (
                <GridRow key={controle.CONROLE_IDENT} style={{ padding: 0, width: "100%" }}>
                    <Segment style={{ margin: 0, width: "100%" }}>
                        <Header>{controle.ACDG_CODE_ACTION} {controle.ACDG_LIBELLE}</Header>
                        <Header> {controle.CPF_LIBELLE}</Header>
                    </Segment>
                </GridRow>))}
        </Grid>
    </Container>
)
